import './styles/App.scss'

import images from './assests/images';
import Dropdown from './components/Dropdown/Dropdown';
import Menu from './components/Menu/Menu';

function App() {

  const imgHeader = images.find(image => image.name === "imgHeader");

  return (
    <>
      <header className="header">
        <div className="header__info">
          <div className="container-center">
            <h1 className="header__info__logo">AIRLINE</h1>
            <Menu />
            <div className='header__lenguage'>
              <Dropdown />
            </div>
          </div>
          Visit Canada with prices from $800

        </div>
        <img src={imgHeader.url} alt={imgHeader.title} className="header__img-back" />
      </header>

    </>





  );
}

export default App;
